const CACHE_NAME="storymap-cache-v1",urlsToCache=["/","/index.html","/offline.html"];self.addEventListener("install",t=>{t.waitUntil(caches.open(CACHE_NAME).then(t=>t.addAll(urlsToCache)))}),self.addEventListener("fetch",t=>{t.respondWith(fetch(t.request).catch(()=>caches.match("/offline.html")))}),self.addEventListener("push",t=>{const e=t.data.json(),s={body:e.options.body};t.waitUntil(self.registration.showNotification(e.title,s))});